import React from 'react'

function ExpenseDetails({ incomeAmt , expenseAmt }) {
    return (
        <div>
            <div>
                Your Balence is {incomeAmt - expenseAmt}
            </div>

            <div className='amounts-container'>
                Income
                <span >{incomeAmt}</span>
            </div>
        </div>
    )
}

export default ExpenseDetails;
